import './style.css'

function App(){

  const appTitle = "Fact Flash";

  return(
    <>
    {/* HEADER */}
    <header className="header">
        <div className="logo">
          <img
            src="logo.png"
            height="68"
            width="68"
            alt="Today I learned logo"
          />
          <h1>{appTitle}</h1>
        </div>
        <button className="btn btn-large btn-open">Share a fact</button>
      </header>

      <NewFactForm />
      <main className='main'>

      <CategoryFilter />
      <FactsList />
      </main>

        </>
  );

}

function NewFactForm(){
  return <form className="fact-form">
    Fact Form
  </form>
}

function CategoryFilter(){
  return <aside> Category filters </aside>
}

function FactsList(){
  return <section>Facts List </section>
}

export default App;
